import React from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Container from 'react-bootstrap/Container';

function Map() {
  return (
    <Jumbotron fluid>
      <Container>
        <h1>Google Map</h1>
        <p>We could put the Map here</p>
      </Container>
    </Jumbotron>
  )
}

export default Map;
